import React from 'react';
import './App.css';
import Icon from './components/icon';
import Navbar from './components/navbar';

function App() {
  return (
    <>
  <div className="navbar">
    <Navbar />
  <div className="icon">
    <Icon />
  </div>
  </div>
  </>
  )
};

export default App;
